import React from 'react';
import './assets/css/App.css';
import logo from './assets/img/logo.png';

function App() {
  return (
    <a href="#" class="sticky-link">
    <div class="sticky-container">
      <img class = "sticky-logo" src= {logo}></img>
      <p>Donation made Great</p>
    </div>
    </a>
  );
}

export default App;
